import * as actionType from '../action/actionTypes';

const initialState = {
    email: null,
    emailValid: false,
    password:null,
    token: null,
    userId: null,
    loading: false,
};

const auth = (state = initialState, action ) =>  {

    switch(action.type) {
        case (actionType.AUTH_START):
            return {
                ...state,
                email : state.email.action.value
            }
    }

    return state;
}

export default auth;
